import Link from "next/link";

const PodcastList = ({ audioClips }) => {
  return (
    audioClips.map( clip => (
      <Link href={`/podcast?id=${clip.id}`}>
        <a> { clip.title } </a>
      </Link>
    ))
  )
}

export default PodcastList;
